import React from "react";
import ItemComponent from "./ItemComponent";

export default function ListComponent(){
    return (
        <div>
            <h2>Minha Lista</h2>
            <ul>
                <ItemComponent name='Meu item'/>
                <li><a href="">Item 2</a></li>
            </ul>
        </div>
    )
}
